import React from 'react';
import './Intro.scss'
import IntroMessage from './IntroMessage/IntorMessage';
import img2 from './welcome_screen_1 1.jpg';

const Intro = () => {
  return (
    <>
      <section className='wrapper'>
          <div className='intro'>
              <h2 className='intro__title'>This is an Internal test task</h2>
                
                 <div className='intro__content'>
                  <IntroMessage/>          
                 <img className='intro__image' src={img2} alt='pokemon' width='359' height='400'/>
            </div>
            
          </div>
          
    
      </section>
     
    </>
  );
}

export default Intro;
